import './index.scss';
import Navbar from '../Navbar';
import { io } from 'socket.io-client';
import {useState} from "react";

const socket = io();
socket.on('alert', (msg) => {
    alert(msg);
});

const Homepage = () => {
    const init = (
        <div className={ 'game-options' }>
            <a>+ Create Game</a>
            <a>+ Join Game</a>
        </div>
    );

    const [main, setMain] = useState(init);

    return (
        <div className={ 'home' }>
            <Navbar />

            { main }
        </div>
    );
}

export default Homepage;
